import React from 'react';
import f from './Friend.module.css';

export default class Friend extends React.Component {
  render() {
    return (
      <div className={f.item}>
        {this.props.stat.map(() => {
          return (
            <h2>
              <b>{this.props.stat.title}</b>
            </h2>
          );
        })}
      </div>
    );
  }
}
